INSERT INTO `new` VALUES (8,'BrainiacChess Online Chess Festival','We are happy to launch the second tournament of the year. Building the community is our utmost priority and we believe this tournament will help that cause. A total of 450,000 Chess Coin has been committed to this tournament',NULL,1604840204463,_binary '\0',_binary '\0',3,'We are happy to launch the second tournament of the year. Building the community is our utmost priority and we believe this tournament will help that cause. A total of 450,000 Chess Coin has been committed to this tournament'),(9,'Launching Staking dApp in 2021','<p>We are happy to launch our first Decentralized Application (dApp). We are always willing to show the community that we are committed to developing the project and bring it to success</p>',NULL,NULL,_binary '\0',_binary '\0',0,'We are happy to launch our first Decentralized Application (dApp). We are always willing to show the community that we are committed to developing the project and bring it to success'),(10,'Tutorial on using the dApp and Interacting with uniswap','As announced in the previous news, we just launched a dApp that rewards liquidity providers to our pool on Uniswap. In order to be able to use the dApp effectively, we thought of making an easy tutorial that will explain how liquidity is added on Uniswap and how to use the dApp afterwards',NULL,1604840204463,_binary '\0',_binary '\0',0,'As announced in the previous news, we just launched a dApp that rewards liquidity providers to our pool on Uniswap. In order to be able to use the dApp effectively, we thought of making an easy tutorial that will explain how liquidity is added on Uniswap and how to use the dApp afterwards'),(11,'BrainiacChess Inter-Federation Tournament Result','Serbia came out as champions, while Turkmenistan were the first runner up despite having the best performing participant of the tournament. Russia is the second runner up with 294 points in total',NULL,1604840204463,_binary '\0',_binary '\0',0,'Serbia came out as champions, while Turkmenistan were the first runner up despite having the best performing participant of the tournament. Russia is the second runner up with 294 points in total'),(12,'Game','<div>content in html</div>',1595787468000,NULL,_binary '',_binary '',0,'small content'),(13,'Game','<div>content in html</div>',1595787468000,NULL,_binary '',_binary '\0',0,'small content'),(14,'Game','<div>content in html</div>',1595787468000,NULL,_binary '',_binary '\0',0,'small content'),(15,'Game','<div>content in html</div>',1595787468000,NULL,_binary '',_binary '\0',0,'small content'),(16,'Updated BrainiacChess Game','<p>Serbia came out as champions, while Turkmenistan were the first runner up despite having the best performing participant of the tournament. Russia is the second runner up with 294 points in total</p>',1595787468000,1609278536586,_binary '\0',_binary '\0',0,'small content with a little edit'),(17,'Game','<div>content in html</div>',1595787468000,NULL,_binary '',_binary '',0,'small content'),(18,'Game','<div>content in html</div>',1595787468000,NULL,_binary '',_binary '',0,'small content'),(19,'Hello Chess','<p>lorem Ipsum lorem Ipsum lorem Ipsum&nbsp;lorem Ipsum lorem Ipsum lorem Ipsum lorem Ipsum&nbsp;lorem Ipsum lorem Ipsum lorem Ipsum lorem Ipsum&nbsp;lorem Ipsum lorem Ipsum lorem Ipsum lorem Ipsum&nbsp;lorem Ipsum</p>',1608690897312,NULL,_binary '',_binary '\0',0,'Hello world from brainiacchess'),(20,'2nd Test Post From BrainiacChess','<p>Serbia came out as champions, while Turkmenistan were the first runner up despite having the best performing participant of the tournament. Russia is the second runner up with 294 points in total</p>',1608691261974,1609278647560,_binary '\0',_binary '\0',0,'lorem Ipsum lorem Ipsum lorem Ipsum  lorem Ipsum'),(21,'3rd Test Post','<p><span style=\"color: rgb(206, 145, 120);\">As announced in the previous news, we just launched a dApp that rewards liquidity providers to our pool 